import React from 'react'
import { Routes, Route, Link } from "react-router-dom";
import Signup from '../pages/Signup';



function HomePageNotLoggedIn({ setUser }) {
  return (
    <div>
        <h1>Welcome to Travelly!</h1>
        <p>Please log in or sign up to explore our amazing travel options.</p>
        <Link to="/login">
                <button
                  type="login"
                  className="w-32 bg-green-600 text-white py-2 rounded-lg hover:bg-green-700 transition-colors shadow-sm ml-8"
                >
                  Get Started
                </button>
              </Link>
    </div>
  )
}

export default HomePageNotLoggedIn
